        }
  `

  const ImgHolder = styled.div`
        width:15vw;
        height:10vw;
      @media (min-width: 1px) and (max-width: 426px) {


        }
  `
  class Contact extends Component {
    componentDidMount(){
      AOS.init({
        duration : 1000
      })
    }
  render() {

      return (

        <Container >
          <MainHeadingContainer>
          <MainHeading data-aos='slide-up'>WORK WITH ME</MainHeading>
          </MainHeadingContainer>
          <ContactHolder>
            <ImgHolder>
              <Img src={me} alt=""/>
            </ImgHolder>
            <div>
              <p>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Assumenda eaque, quas magni a corrupti veniam quisquam culpa, adipisci neque iusto asperiores necessitatibus modi ipsa architecto, recusandae sequi facere facilis ad incidunt aliquid corporis repellendus odit nisi dicta? Eius unde ut veritatis! Eligendi sint alias eius? Aliquam ab fugit pariatur modi!</p>
            </div>
          </ContactHolder>
        </Container>
    );
    }
  }

  export default Contact;
